import React from 'react'
import { Grid, Menu, Segment, Dropdown} from "semantic-ui-react";

const yearOptions = [
    {
      key: 2017,
      text: 2017,
      value: 2017,
    },
    {
        key: 2018,
        text: 2018,
        value: 2018,
    },
    {
        key: 2019,
        text: 2019,
        value: 2019,
    },
    {
        key: 2020,
        text: 2020,
        value: 2020,
    },
  ]

const Visualization = () => {
    return (
        <div>
              <Dropdown
    placeholder='Select Year'
    fluid
    selection
    options={yearOptions}
  />
        </div>
    )
}

export default Visualization
